import logoImg from '../../assets/logo.png'
import { Container, Content } from './styles'

export function Header(){
  return (
    <Container>
      <Content>
      <img src={logoImg} alt="Logo Discografia" />
      <h1>Discografia</h1>
      </Content>
    </Container>
  )
}
